import React from 'react'

class App extends React.Component{
  constructor() {
    super()
    this.state = {show: [1,2,3,4,5]}
  }

  // hideText() {
  //   this.setState({show: !this.state.show})
  // }

  render() {    
    let li = this.state.show.map((item, index) => {
      return <li>{item}</li>
    })

    return <div>
        <ul>
          {li}
        </ul>
        <button>Click</button>
    </div>
  }
}

export default App;
